"original": |2-
     This RECOMMENDED Printer attribute specifies the nominal number of
     pages per minute to the nearest whole number that can be generated by
     this Printer (e.g., simplex, black-and-white).  This attribute is
     informative, not a service guarantee.  Generally, it is the value
     used in the marketing literature to describe the speed of the device.
"fixed": |-
  This RECOMMENDED Printer attribute specifies the nominal number of pages per minute to the nearest whole number that can be generated by this Printer (e.g., simplex, black-and-white).  This attribute is informative, not a service guarantee.  Generally, it is the value used in the marketing literature to describe the speed of the device.
"ko": |-
  이 RECOMMENDED 프린터 속성은 이 프린터에서 생성할 수 있는 가장 가까운 정수로 분당 명목 페이지 수를 지정합니다(예: 단면, 흑백). 이 속성은 정보 제공용이며 서비스 보장이 아닙니다. 일반적으로 마케팅 문헌에서 장치의 속도를 설명하는 데 사용되는 값입니다.
